Malo (50 Cent) is de zoon van een overleden politieagent, die voor hetzelfde beroep als zijn vader kiest. De nieuweling wordt onder de vleugels genomen door de voormalige partner van zijn vader en komt terecht in een team bestaande uit ruige en onbetrouwbare agenten. Zijn nieuwe baas is Vic Sarcone (Robert De Niro). Het duurt niet lang voordat Malo zich begint af te vragen aan welke kant van de wet hij zich bevindt.



